import React from 'react';
import './nav.css';

function TextBox(props) {
  // make this into different text boxes for different sizes and positions

  return (
    <div id='general' class="container">
      <h3 className="intro">{props.value}</h3>
      <h3 className="bg-white rounded-">A forward thinking team helping the people and our ecosystem rejuvenate their health. We are your source for locally grown, fresh microgreens. We establish pollinator gardens in your local communities. Feeding those small as bees to those big as Shaq, from microgreens to evergreens, we are Evolution Urban Grows!
      </h3>
    </div>
  );
}

export default TextBox;
